export default class Server {
    async getResource() {
        const res = await fetch(`https://newsapi.org/v2/top-headlines?' +
          'country=us&' +
          'apiKey=f566edbf781c4d2ba135236a869fa6ae'`);

        if (!res.ok) {
            throw new Error(res.status);
        }
        return await res.json();
    }
}
